    /// <summary>
    /// Gen 5 Easy Chat dictionary
    /// </summary>
    class EasyChatGen5 : EasyChat
    {
        private Language language;

        /// <summary>
        /// Creates a new Gen 5 Easy Chat dictionary.
        /// </summary>
        /// <param name="l"><see cref="PokeDictionary.Language">Language</see> of the dictionary.</param>
        public EasyChatGen5(Language l)
        {
            language = l;
        }

        /// <summary>
        /// Gets the Easy Chat word/phrase for the given value.
        /// </summary>
        /// <param name="value"></param>
        /// <returns></returns>
        public override string GetWord(short value)
        {
            string w = null;
            bool b = false;

            switch (language)
            {
                case Language.English: b = ENG.TryGetValue(value, out w); break;
                case Language.French: b = FRE.TryGetValue(value, out w); break;
                case Language.German: b = GER.TryGetValue(value, out w); break;
                case Language.Italian: b = ITA.TryGetValue(value, out w); break;
                case Language.Spanish: b = SPA.TryGetValue(value, out w); break;
                case Language.Japanese: b = JAP.TryGetValue(value, out w); break;
                case Language.Korean: b = KOR.TryGetValue(value, out w); break;
                default: b = false; break;
            }

            if (!b)
                throw new Exception("Invalid value");

            return w;
        }

        /// <summary>
        /// Gets the Easy Chat value for the given word/phrase.
        /// </summary>
        /// <param name="word"></param>
        /// <returns></returns>
        public override short GetValue(string word)
        {
            short s = 0;
            bool b = false;

            switch (language)
            {
                case Language.English: b = ENG_Values.TryGetValue(word, out s); break;
                case Language.French: b = FRE_Values.TryGetValue(word, out s); break;
                case Language.German: b = GER_Values.TryGetValue(word, out s); break;
                case Language.Italian: b = ITA_Values.TryGetValue(word, out s); break;
                case Language.Spanish: b = SPA_Values.TryGetValue(word, out s); break;
                case Language.Japanese: b = JAP_Values.TryGetValue(word, out s); break;
                case Language.Korean: b = KOR_Values.TryGetValue(word, out s); break;
                default: b = false; break;
            }

            if (!b)
                throw new Exception("Unknown word/phrase");

            return s;
        }

        /// <summary>
        /// The language of the Easy Chat dictionary.
        /// </summary>
        public override Language Language
        {
            get { return language; }
            set { language = value; }
        }

        /// <summary>
        /// The generation of the Easy Chat dictionary.
        /// </summary>
        public override Generation Generation
        {
            get { return Generation.Gen5; }
        }

        /// <summary>
        /// Gets all the words from the dictionary of the specified <see cref="PokeDictionary.Language">Language</see>.
        /// </summary>
        /// <param name="l"><see cref="PokeDictionary.Language">Language</see> of the dictionary.</param>
        /// <returns></returns>
        public static string[] GetWords(Language l)
        {
            switch (l)
            {
                case Language.English: return ENG_Values.Keys.ToArray();
                case Language.French: return FRE_Values.Keys.ToArray();
                case Language.German: return GER_Values.Keys.ToArray();
                case Language.Italian: return ITA_Values.Keys.ToArray();
                case Language.Spanish: return SPA_Values.Keys.ToArray();
                case Language.Japanese: return JAP_Values.Keys.ToArray();
                case Language.Korean: return KOR_Values.Keys.ToArray();
                default: return null;
            }
        }

        /// <summary>
        /// The words of the Easy Chat dictionary.
        /// </summary>
        public override string[] Words
        {
            get { return GetWords(language); }
        }

